def detect_img(image):
    resultList = []
    base64_data = re.sub('^data:image/.+;base64,', '', image)
    byte_data = base64.b64decode(base64_data)
    image_data = BytesIO(byte_data)
    image = Image.open(image_data)
    # image.show()
    net = darknet.load_net(b"modelData/ObjReg/yolov3-tiny.cfg", b"modelData/ObjReg/ObjRegv3.weights", 0)
    meta = darknet.load_meta(b"modelData/ObjReg/data.data")
    try:
        filename = str(int(random.uniform(100000, 10000000)))
        try:
            image.save('temp/' + filename + '.jpg')
        except OSError:
            image = image.convert('RGB')
            image.save('temp/' + filename + '.jpg')
        string = 'temp/' + filename + '.jpg'
        # image.show()
        result = darknet.detect(net, meta, bytes(string, encoding='utf8'))
        # temp.show()
        # print(resultList[-1])
    finally:
        os.remove('temp/' + filename + '.jpg')
    # out_boxes, out_scores, out_classes = objReg.detect_image(image)
    # print(out_boxes,out_classes,out_scores)
    # objReg.close_session()

    resName = open('itemList.txt').readlines()
    # print(type(out_classes))
    net = darknet.load_net(b"modelData/Numdet/yolov3-tiny.cfg", b"modelData/Numdet/yolov3-tiny_final.weights", 0)
    meta = darknet.load_meta(b"modelData/Numdet/data2.data")
    for i in range(result.__len__()):
        x, y, w, h = result[i][2]
        top = x - h / 2
        left = y - w / 2
        bottom = x + h / 2
        right = y + w / 2

        #print(top, left, bottom, right)
        size = max(right - left, bottom - top)
        temp = image.crop((top, left, top + size, left + size,))
        try:
            filename = str(int(random.uniform(100000, 10000000)))
            try:
                temp.save('temp/' + filename + '.jpg')
            except OSError:
                temp = temp.convert('RGB')
                temp.save('temp/' + filename + '.jpg')
            string = 'temp/' + filename + '.jpg'
            #temp.show()
            resultList.append(
                [str(result[i][0]).replace('b\'', '').replace('\'', ''),
                 getNum(darknet.detect(net, meta, bytes(string, encoding='utf8'), hier_thresh=.75)), result[i][1]])
            # temp.show()
            # print(resultList[-1])
        finally:
            os.remove('temp/' + filename + '.jpg')
    return resultList


