def getNum(results):
    if results == []:
        #print("Failed")
        return
    #print(results)
    out_boxes = []
    out_scores = []
    out_classes = []
    for result in results:
        if result[1] < 0.7:
            pass
        out_boxes.append(result[2])
        out_scores.append(result[1])
        out_classes.append(int(result[0]))
    #print(out_classes)
    out = 0

    while out_boxes.__len__() != 0:
        num = -1
        tmp = 1919810
        maxIndex = 0
        for i in range(out_boxes.__len__()):
            if out_boxes[i][0] < tmp:
                tmp = out_boxes[i][0]
                num = out_classes[i]
                maxIndex = i
        out_boxes.pop(maxIndex)
        out_classes.pop(maxIndex)
        out = out * 10 + num
    return out


